    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>const rescaleSlides = () => {
  const slides = document.querySelectorAll('.remark-slide-scaler')
  slides.forEach(slide => {
    /* In the future, might enable remark scaling restore
    slide.dataset.original = JSON.stringify({
      top: slide.style.top,
      left: slide.style.left,
      width: slide.style.width,
      height: slide.style.height,
    });
    */
    slide.style.width = `${window.innerWidth}px`
    slide.style.height = `${window.innerHeight}px`
    slide.style.transform = 'scale(1)'
    slide.style.top = '0'
    slide.style.left = '0'
  })
}

const rescaleOnResize = ev => {
  ev.stopPropagation()
  rescaleSlides()
}

const startFitScreen = () => {
  window.addEventListener('resize', rescaleOnResize)
  rescaleSlides()
}

document.addEventListener('keydown', ev => {
  if (ev.altKey && ev.keyCode === 70) {
    // Alt + F
    startFitScreen()
  }
})

const addFitScreenHelpText = () => {
  const helpTable = document.querySelector(
    '.remark-help-content table.light-keys'
  )
  if (!helpTable) {
    console.error(
      'Could not find remark help table, has remark been initialized?'
    )
    return
  }
  const newRow = document.createElement('tr')
  newRow.innerHTML += '<td><span class="key">Alt</span> + <span class="key">f</span></td>'
  newRow.innerHTML += '<td>Fit Slides to Screen</td>'
  helpTable.append(newRow)
}

document.addEventListener('DOMContentLoaded', addFitScreenHelpText)
</script>

    <script>/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    [...document.querySelectorAll('.panel-name')]
      .map(el => el.textContent.trim())

    const panelIds = {}

    const uniquePanelId = (name) => {
      name = encodeURIComponent(name.toLowerCase().replace(/[\s]/g, '-'))
      if (Object.keys(panelIds).includes(name)) {
        name += ++panelIds[name]
      } else {
        panelIds[name] = 1
      }
      return name
    }

    const identifyPanelName = (item) => {
      let name = 'Panel'

      // If the item doesn't have a parent element, then we've already processed
      // it, probably because we're in an Rmd, and it's been removed from the DOM
      if (!item.parentElement) {
        return
      }

      // In R Markdown when header-attrs.js is present, we may have found a
      // section header but the class attributes won't be duplicated on the <hX> tag
      if (
        (item.tagName === 'SECTION' || item.classList.contains('section')) &&
        /^H[1-6]/.test(item.children[0].tagName)
      ) {
        name = item.children[0].textContent
        item.classList.remove('panel-name')
        item.removeChild(item.children[0])
        return name
      }

      const nameDiv = item.querySelector('.panel-name')
      if (!nameDiv) return name

      // In remarkjs the .panel-name span might be in a paragraph tag
      // and if the <p> is empty, we'll remove it
      if (
        nameDiv.tagName === 'SPAN' &&
        nameDiv.parentNode.tagName === 'P' &&
        nameDiv.textContent === nameDiv.parentNode.textContent
      ) {
        name = nameDiv.textContent
        item.removeChild(nameDiv.parentNode)
        return name
      }

      // If none of the above, remove the nameDiv and return the name
      name = nameDiv.textContent
      nameDiv.parentNode.removeChild(nameDiv)
      return name
    }

    const processPanelItem = (item) => {
      const name = identifyPanelName(item)
      if (!name) {
        return null
      }
      return { name, content: item.children, id: uniquePanelId(name) }
    }

    const getCurrentPanelFromUrl = (panelset) => {
      const params = new URLSearchParams(window.location.search)
      return params.get(panelset)
    }

    const reflowPanelSet = (panels, idx) => {
      const res = document.createElement('div')
      res.className = 'panelset'
      res.id = 'panelset' + (idx > 0 ? idx : '')
      const panelSelected = getCurrentPanelFromUrl(res.id)

      // create header row
      const headerRow = document.createElement('ul')
      headerRow.className = 'panel-tabs'
      headerRow.setAttribute('role', 'tablist')
      panels
        .map((p, idx) => {
          const panelHeaderItem = document.createElement('li')
          panelHeaderItem.className = 'panel-tab'
          panelHeaderItem.setAttribute('role', 'tab')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          if (thisPanelIsActive) {
            panelHeaderItem.classList.add('panel-tab-active')
            panelHeaderItem.setAttribute('aria-selected', true)
          }
          panelHeaderItem.tabIndex = 0
          panelHeaderItem.id = res.id + '_' + p.id // #panelsetid_panelid

          const panelHeaderLink = document.createElement('a')
          panelHeaderLink.href = '?' + res.id + '=' + p.id + '#' + panelHeaderItem.id
          panelHeaderLink.setAttribute('onclick', 'return false;')
          panelHeaderLink.tabIndex = -1 // list item is tabable, not link
          panelHeaderLink.innerHTML = p.name
          panelHeaderLink.setAttribute('aria-controls', p.id)

          panelHeaderItem.appendChild(panelHeaderLink)
          return panelHeaderItem
        })
        .forEach(el => headerRow.appendChild(el))

      res.appendChild(headerRow)

      panels
        .map((p, idx) => {
          const panelContent = document.createElement('section')
          panelContent.className = 'panel'
          panelContent.setAttribute('role', 'tabpanel')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          panelContent.classList.toggle('panel-active', thisPanelIsActive)
          panelContent.id = p.id

     * @param panelset Panelset ID to update in the search params
     * @param panel Panel ID of selected panel in panelset, or null to delete from search params
     * @param params Current params object, or params from window.location.search

      const { pathname, hash } = window.location
      const uri = pathname + params + hash
      window.history.replaceState(uri, '', uri)

      if (!clicked.classList.contains('panel-tab')) return
      if (clicked.classList.contains('panel-tab-active')) return

        .querySelectorAll('.panel-tab')
      const panels = clicked.parentNode.parentNode
        .querySelectorAll('.panel')
      const panelTabClicked = clicked.children[0].getAttribute('aria-controls')
      const panelClicked = clicked.parentNode.parentNode.id

      Array.from(tabs)
        .forEach(t => {
          t.classList.remove('panel-tab-active')
          t.removeAttribute('aria-selected')
        })
      Array.from(panels)
        .forEach(p => {
          const active = p.id === panelTabClicked

      clicked.setAttribute('aria-selected', true)

      updateUrl(params)

      let panels = Array.from(panelset.querySelectorAll('.panel'))
      if (!panels.length && panelset.matches('.section[class*="level"]')) {
        // we're in tabset-alike R Markdown
        const panelsetLevel = [...panelset.classList]
          .filter(s => s.match(/^level/))[0]
          .replace('level', '')

        // move children that aren't inside a section up above the panelset
        Array.from(panelset.children).forEach(function (el) {
          if (el.matches('div.section[class*="level"]')) return
          panelset.parentElement.insertBefore(el, panelset)
        })

        // panels are all .sections with .level<panelsetLevel + 1>
        const panelLevel = +panelsetLevel + 1
        panels = Array.from(panelset.querySelectorAll(`.section.level${panelLevel}`))
      }

      if (!panels.length) return

      const contents = panels.map(processPanelItem).filter(o => o !== null)
      const newPanelSet = reflowPanelSet(contents, idx)
      newPanelSet.classList = panelset.classList
      panelset.parentNode.insertBefore(newPanelSet, panelset)
      panelset.parentNode.removeChild(panelset)

      // click and touch events
      const panelTabs = newPanelSet.querySelector('.panel-tabs');
      ['click', 'touchend'].forEach(eventType => {
        panelTabs.addEventListener(eventType, function (ev) {
          togglePanel(ev.target)
          ev.stopPropagation()
        })
      })
      panelTabs.addEventListener('touchmove', function (ev) {
        ev.preventDefault()
      })

      // key events
      newPanelSet
        .querySelector('.panel-tabs')
        .addEventListener('keydown', (ev) => {
          const self = ev.currentTarget.querySelector('.panel-tab-active')
          if (ev.code === 'Space' || ev.code === 'Enter') {
            togglePanel(ev.target)
            ev.stopPropagation()

            self.previousSibling.focus()
            ev.stopPropagation()
          } else if (ev.code === 'ArrowRight' && self.nextSibling) {
            togglePanel(self.nextSibling)
            self.nextSibling.focus()
            ev.stopPropagation()
          }
        })

      return panels
    }

    Array.from(document.querySelectorAll('.panelset')).map(initPanelSet)

    if (typeof slideshow !== 'undefined') {
      const getVisibleActivePanelInfo = () => {
        const slidePanels = document.querySelectorAll('.remark-visible .panel-tab-active')

        if (!slidePanels.length) return null

        return slidePanels.map(panel => {
          return {
            panel,
            panelId: panel.children[0].getAttribute('aria-controls'),
            panelSetId: panel.parentNode.parentNode.id
          }
        })
      }

      slideshow.on('hideSlide', slide => {
        // clear focus if we had a panel-tab selected

    <script>/* global Cookies */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(makeEditable)

  function makeEditable () {
    const docId = JSON.parse(
      document.getElementById('xaringanExtra-editable-docid').textContent
    )
    docId.id = 'editable_' + docId.id

    const blockEvents = ev => ev.stopPropagation()
    const getKey = el => Array.from(el.classList).filter(c => c.match('key'))[0]
    const html2json = el => window.himalaya.parse(el.innerHTML)
    const json2html = json => window.himalaya.stringify(json)

    function storeElement (el) {
      let stored = Cookies.get(docId.id)
      stored = stored ? JSON.parse(stored) : {}
      const key = getKey(el)
      if (!key) return
      stored[key] = html2json(el)
      Cookies.set(docId.id, JSON.stringify(stored), { expires: docId.expires, sameSite: 'None', secure: true })
    }

    function updateElement (el) {
      const key = getKey(el)
      if (!key) return
      let stored = Cookies.get(docId.id)
      if (!stored) return
      stored = JSON.parse(stored)
      if (!Object.keys(stored).includes(key)) return
      el.innerHTML = json2html(stored[key])
    }

    function setIsEditingClass () {
      document.body.classList.add('xe-editable_is-editing')
    }

    function removeIsEditingClass () {
      document.body.classList.remove('xe-editable_is-editing')
    }

    window.editable = {
      clearCookies () {
        Cookies.remove(docId.id)
      },
      clearCookiesAll () {
        Object.keys(Cookies.get())
          .filter(key => key.match(/^editable_/))
          .forEach(key => Cookies.remove(key))
      }
    }

    const editables = document.querySelectorAll('.can-edit')
    if (!editables.length) return

    editables.forEach(el => {
      el.setAttribute('contenteditable', true)
      el.setAttribute('autocomplete', 'off')
      el.setAttribute('autocorrect', 'off')
      el.setAttribute('spellcheck', false)
      updateElement(el)
    })

    editables.forEach(function (el) {
      el.addEventListener('focus', function () {
        if (window.editable.debug) console.log('[editable] blocking shortcuts')
        setIsEditingClass()
        slideshow.pause()
        el.addEventListener('keyup', blockEvents)
        el.addEventListener('keydown', blockEvents)
        el.addEventListener('keypress', blockEvents)
      })
      el.addEventListener('input', function () {
        el.willStore = true
      })
      el.addEventListener('blur', function () {
        if (window.editable.debug) console.log('[editable] unblocking shortcuts')
        slideshow.resume()
        removeIsEditingClass()
        el.removeEventListener('keyup', blockEvents)
        el.removeEventListener('keydown', blockEvents)
        el.removeEventListener('keypress', blockEvents)
        if (el.willStore) {
          el.willStore = false
          if (window.editable.debug) console.log('[editable] storing update html')
          storeElement(el)
        }
      })
    })
  }
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}
</script>

    <style type="text/css">:root {
--search-icon-fill: rgba(128, 128, 128, 0.5);
--search-input-background: rgb(204, 204, 204);
--search-input-foreground: black;
--search-match-background: rgba(255, 196, 136, 0.75);
--search-input-border: 1px solid rgb(249, 38, 114);
--search-match-foreground: black;
--search-match-current-background: rgba(255, 136, 255, 0.75);
--search-match-current-foreground: black;
}
div.search {
position: absolute;
top: 1em;
}
div.search form {
display: none;
animation: fadeIn 250ms ease-out 1;
}
div.search.search-input-visible form {
display: inline-block;
}
div.search form input {
background-color: var(--search-input-background);
color: var(--search-input-foreground);
border: var(--search-input-border);
padding: 3px;
width: 10em;
}
div.search a {
padding: 0 0.5em;
}
div.search #search-open {
cursor: pointer;
display: none;
animation: fadeIn 250ms ease-out 1;
}
@keyframes fadeIn {
0% { opacity: 0 }
100% { opacity: 1 }
}
div.search.search-icon-visible #search-open {
display: inline-block;
}
div.search #search-open svg {
fill: var(--search-icon-fill);
vertical-align: bottom;
margin-bottom: -4px;
}
div.search #search-next{
display: none;
}
span.match.current-match {
background-color: var(--search-match-current-background);
color: var(--search-match-current-foreground);
}
span.match {
padding: 1px;
background-color: var(--search-match-background);
color: var(--search-match-foreground);
transition: background-color 200ms ease-in-out, color 200ms ease-in-out;
}
</style>
    <script>class RemarkSearch {
  constructor (options) {
    this.matches = []

    if (options == null) options = {}
    if (options.position == null) options.position = 'bottom-left'
    if (options.caseSensitive == null) options.caseSensitive = false
    if (options.showIcon == null) options.showIcon = true

  showMatch (event, delta) {

    if (this.matches.length == 0) { return this.doSearch(event) }

    let index = 1
    while (match.previousSibling != null) {
      match = match.previousSibling
      index++
    };

    if (slideshow.getCurrentSlideIndex() + 1 != index) { slideshow.gotoSlide(index) }

  }

    <script>/* globals Shiny,Audio */
class CountdownTimer {
  constructor (el, opts) {
    if (typeof el === 'string' || el instanceof String) {
      el = document.querySelector(el)
    }

    if (el.counter) {
      return el.counter
    }

    const minutes = parseInt(el.querySelector('.minutes').innerText || '0')
    const seconds = parseInt(el.querySelector('.seconds').innerText || '0')
    const duration = minutes * 60 + seconds

    function attrIsTrue (x) {
      if (x === true) return true
      return !!(x === 'true' || x === '' || x === '1')
    }

    this.element = el
    this.duration = duration
    this.end = null
    this.is_running = false
    this.warn_when = parseInt(el.dataset.warnWhen) || -1
    this.update_every = parseInt(el.dataset.updateEvery) || 1
    this.play_sound = attrIsTrue(el.dataset.playSound)
    this.blink_colon = attrIsTrue(el.dataset.blinkColon)
    this.startImmediately = attrIsTrue(el.dataset.startImmediately)
    this.timeout = null
    this.display = { minutes, seconds }

    if (opts.src_location) {
      this.src_location = opts.src_location
    }

    this.addEventListeners()
  }

  addEventListeners () {
    const self = this

    if (this.startImmediately) {
      if (window.remark && window.slideshow) {
        // Remark (xaringan) support
        const isOnVisibleSlide = () => {
          return document.querySelector('.remark-visible').contains(self.element)
        }
        if (isOnVisibleSlide()) {
          self.start()
        } else {
          let started_once = 0
          window.slideshow.on('afterShowSlide', function () {
            if (started_once > 0) return
            if (isOnVisibleSlide()) {
              self.start()
              started_once = 1
            }
          })
        }
      } else if (window.Reveal) {
        // Revealjs (quarto) support
        const isOnVisibleSlide = () => {
          const currentSlide = document.querySelector('.reveal .slide.present')
          return currentSlide ? currentSlide.contains(self.element) : false
        }
        if (isOnVisibleSlide()) {
          self.start()
        } else {
          const revealStartTimer = () => {
            if (isOnVisibleSlide()) {
              self.start()
              window.Reveal.off('slidechanged', revealStartTimer)
            }
          }
          window.Reveal.on('slidechanged', revealStartTimer)
        }
      } else if (window.IntersectionObserver) {
        // All other situtations use IntersectionObserver
        const onVisible = (element, callback) => {
          new window.IntersectionObserver((entries, observer) => {
            entries.forEach(entry => {
              if (entry.intersectionRatio > 0) {
                callback(element)
                observer.disconnect()
              }
            })
          }).observe(element)
        }
        onVisible(this.element, el => el.countdown.start())
      } else {
        // or just start the timer as soon as it's initialized
        this.start()
      }
    }

      ev.preventDefault()
      ev.stopPropagation()
    }
    function isSpaceOrEnter (ev) {
      return ev.code === 'Space' || ev.code === 'Enter'
    }
    function isArrowUpOrDown (ev) {
      return ev.code === 'ArrowUp' || ev.code === 'ArrowDown'
    }

    ;['click', 'touchend'].forEach(function (eventType) {
      self.element.addEventListener(eventType, function (ev) {
        haltEvent(ev)
        self.is_running ? self.stop() : self.start()
      })
    })
    this.element.addEventListener('keydown', function (ev) {
      if (ev.code === "Escape") {
        self.reset()
        haltEvent(ev)
      }
      if (!isSpaceOrEnter(ev) && !isArrowUpOrDown(ev)) return
      haltEvent(ev)
      if (isSpaceOrEnter(ev)) {
        self.is_running ? self.stop() : self.start()
        return
      }

      if (!self.is_running) return

      if (ev.code === 'ArrowUp') {
        self.bumpUp()
      } else if (ev.code === 'ArrowDown') {
        self.bumpDown()
      }

    this.element.addEventListener('dblclick', function (ev) {
      haltEvent(ev)
      if (self.is_running) self.reset()

    ;['click', 'touchend'].forEach(function (eventType) {

        haltEvent(ev)
        if (self.is_running) self.bumpDown()
      })
    })
    btnBumpDown.addEventListener('keydown', function (ev) {
      if (!isSpaceOrEnter(ev) || !self.is_running) return
      haltEvent(ev)
      self.bumpDown()
    })

    const btnBumpUp = this.element.querySelector('.countdown-bump-up')
    ;['click', 'touchend'].forEach(function (eventType) {
      btnBumpUp.addEventListener(eventType, function (ev) {
        haltEvent(ev)
        if (self.is_running) self.bumpUp()
      })
    })
    btnBumpUp.addEventListener('keydown', function (ev) {
      if (!isSpaceOrEnter(ev) || !self.is_running) return
      haltEvent(ev)
      self.bumpUp()

  remainingTime () {
    const remaining = this.is_running
      ? (this.end - Date.now()) / 1000
      : this.remaining || this.duration

    let minutes = Math.floor(remaining / 60)
    let seconds = Math.ceil(remaining - minutes * 60)

      seconds = seconds - 60

      this.end = Date.now() + this.remaining * 1000
      this.remaining = null

    this.element.classList.remove('finished')
    this.element.classList.add('running')

    this.tick()

  tick (run_again) {

      run_again = true
    }

    if (!this.is_running) return

      this.element.classList.remove('blink-colon')
      return
    }
    const { seconds: secondsIs } = this.display
    if (secondsIs > 10 || secondsWas !== secondsIs) {
      this.element.classList.toggle('blink-colon')
    }
  }

  update (force) {
    if (typeof force === 'undefined') {
      force = false
    }

    const { remaining, minutes, seconds } = this.remainingTime()

    const setRemainingTime = (selector, time) => {
      const timeContainer = this.element.querySelector(selector)
      if (!timeContainer) return
      time = Math.max(time, 0)
      timeContainer.innerText = String(time).padStart(2, 0)
    }

    if (this.is_running && remaining < 0.25) {
      this.stop()
      setRemainingTime('.minutes', 0)
      setRemainingTime('.seconds', 0)
      this.playSound()
      return
    }

    const should_update = force ||
      Math.round(remaining) < this.warn_when ||
      Math.round(remaining) % this.update_every === 0

      this.element.classList.toggle('warning', remaining <= this.warn_when)
      this.display = { minutes, seconds }
      setRemainingTime('.minutes', minutes)
      setRemainingTime('.seconds', seconds)
    }
  }

  stop () {
    const { remaining } = this.remainingTime()
    if (remaining > 1) {
      this.remaining = remaining
    }
    this.element.classList.remove('running')
    this.element.classList.remove('warning')
    this.element.classList.remove('blink-colon')
    this.element.classList.add('finished')
    this.is_running = false
    this.end = null
    this.reportStateToShiny('stop')
    this.timeout = clearTimeout(this.timeout)
  }

  reset () {
    this.stop()
    this.remaining = null
    this.update(true)
    this.reportStateToShiny('reset')
    this.element.classList.remove('finished')
    this.element.classList.remove('warning')
  }

  setValues (opts) {
    if (typeof opts.warn_when !== 'undefined') {
      this.warn_when = opts.warn_when
    }
    if (typeof opts.update_every !== 'undefined') {
      this.update_every = opts.update_every
    }
    if (typeof opts.blink_colon !== 'undefined') {
      this.blink_colon = opts.blink_colon
      if (!opts.blink_colon) {
        this.element.classList.remove('blink-colon')
      }
    }
    if (typeof opts.play_sound !== 'undefined') {
      this.play_sound = opts.play_sound
    }
    if (typeof opts.duration !== 'undefined') {
      this.duration = opts.duration
      if (this.is_running) {
        this.reset()
        this.start()
      }
    }
    this.reportStateToShiny('update')
    this.update(true)
  }

  bumpTimer (val, round) {
    round = typeof round === 'boolean' ? round : true
    const { remaining } = this.remainingTime()
    let newRemaining = remaining + val
    if (newRemaining <= 0) {
      this.setRemaining(0)
      this.stop()
      return
    }
    if (round && newRemaining > 10) {
      newRemaining = Math.round(newRemaining / 5) * 5
    }
    this.setRemaining(newRemaining)
    this.reportStateToShiny(val > 0 ? 'bumpUp' : 'bumpDown')
    this.update(true)
  }

  bumpUp (val) {
    if (!this.is_running) {
      console.error('timer is not running')
      return
    }
    this.bumpTimer(
      val || this.bumpIncrementValue(),
      typeof val === 'undefined'
    )
  }

  bumpDown (val) {
    if (!this.is_running) {
      console.error('timer is not running')
      return
    }
    this.bumpTimer(
      val || -1 * this.bumpIncrementValue(),
      typeof val === 'undefined'
    )
  }

  setRemaining (val) {
    if (!this.is_running) {
      console.error('timer is not running')
      return
    }
    this.end = Date.now() + val * 1000
    this.update(true)
  }

  playSound () {
    let url = this.play_sound
    if (!url) return
    if (typeof url === 'boolean') {
      const src = this.src_location
        ? this.src_location.replace('/countdown.js', '')
        : 'libs/countdown'
      url = src + '/smb_stage_clear.mp3'
    }
    const sound = new Audio(url)
    sound.play()
  }

  bumpIncrementValue (val) {
    val = val || this.remainingTime().remaining
    if (val <= 30) {
      return 5
    } else if (val <= 300) {
      return 15
    } else if (val <= 3000) {
      return 30
    } else {
      return 60
    }
  }

  reportStateToShiny (action) {
    if (!window.Shiny) return

    const inputId = this.element.id
    const data = {
      event: {
        action,
        time: new Date().toISOString()
      },
      timer: {
        is_running: this.is_running,
        end: this.end ? new Date(this.end).toISOString() : null,
        remaining: this.remainingTime()
      }
    }

    function shinySetInputValue () {
      if (!window.Shiny.setInputValue) {
        setTimeout(shinySetInputValue, 100)
        return
      }
      window.Shiny.setInputValue(inputId, data)
    }

    shinySetInputValue()
  }
}

(function () {
  const CURRENT_SCRIPT = document.currentScript.getAttribute('src')

  document.addEventListener('DOMContentLoaded', function () {
    const els = document.querySelectorAll('.countdown')
    if (!els || !els.length) {
      return
    }
    els.forEach(function (el) {
      el.countdown = new CountdownTimer(el, { src_location: CURRENT_SCRIPT })
    })

    if (window.Shiny) {
      Shiny.addCustomMessageHandler('countdown:update', function (x) {
        if (!x.id) {
          console.error('No `id` provided, cannot update countdown')
          return
        }
        const el = document.getElementById(x.id)
        el.countdown.setValues(x)
      })

      Shiny.addCustomMessageHandler('countdown:start', function (id) {
        const el = document.getElementById(id)
        if (!el) return
        el.countdown.start()
      })

      Shiny.addCustomMessageHandler('countdown:stop', function (id) {
        const el = document.getElementById(id)
        if (!el) return
        el.countdown.stop()
      })

      Shiny.addCustomMessageHandler('countdown:reset', function (id) {
        const el = document.getElementById(id)
        if (!el) return
        el.countdown.reset()
      })

      Shiny.addCustomMessageHandler('countdown:bumpUp', function (id) {
        const el = document.getElementById(id)
        if (!el) return
        el.countdown.bumpUp()
      })

      Shiny.addCustomMessageHandler('countdown:bumpDown', function (id) {
        const el = document.getElementById(id)
        if (!el) return
        el.countdown.bumpDown()
      })
    }
  })
})()

## Learning Objectives for Today&#39;s Class

- Create quick visualizations using the `plot` method from [pandas](https://pandas.pydata.org/docs/user_guide/visualization.html) (with an understanding of the effect of different backends).  

- Utilize `auto-viz` type plots to create a quick EDA of your data.

# Plotting with Pandas

---

## Our Data

- We will use the `merged_ips` data set from a previous class to demonstrate how to plot data in pandas.

.font80[

```python
import pandas as pd

toxic_ips = pd.read_csv(
  &quot;https://raw.githubusercontent.com/fmegahed/isa419/main/data/listed_ip_90_all.csv&quot;, 
  header = None, names = [&#39;ip&#39;, &#39;frequency&#39;, &#39;lastseen&#39;]
)

geolocation = pd.read_csv(
  &#39;https://raw.githubusercontent.com/fmegahed/isa419/main/data/ip_geolocation.csv&#39;, 
  names = [&#39;ip&#39;, &#39;country&#39;, &#39;city&#39;, &#39;latitude&#39;, &#39;longitude&#39;]
)

merged_ips = (
  toxic_ips
  .merge(right = geolocation, how = &#39;left&#39;, on =&#39;ip&#39;)
  .dropna()
  .assign( lastseen = lambda df: df[&#39;lastseen&#39;].astype(&#39;datetime64[ns]&#39;) )
)
merged_ips.dtypes[0:3]
```

```
## ip                   object
## frequency             int64
## lastseen     datetime64[ns]
## dtype: object
```

## Plotting with Pandas

- The `plot` method in pandas is a wrapper around `matplotlib` (by default) and is a quick way to visualize data.

- The `plot` method is available on both `Series` and `DataFrame` objects.

## Plotting with Pandas (`line` Plot)

.pull-left[
.font80[

.center[**Data Prep:**]


```python
# Aggregating the frequencies by day
daily_freq = (
  merged_ips
  .groupby(merged_ips[&#39;lastseen&#39;].dt.date)
  .agg(sum_freq = (&#39;frequency&#39;, &#39;sum&#39;))
  .reset_index() # to have last seen as col
  .rename(columns = {&#39;lastseen&#39;: &#39;date&#39;})
)

daily_freq.head(n=2)
```

```
##          date  sum_freq
## 0  2023-10-26      8952
## 1  2023-10-27      4642
```
]
]

.pull-right[
.font80[

.center[**Plotting:**]


```python
daily_freq.plot(
  x = &#39;date&#39;, y = &#39;sum_freq&#39;, kind = &#39;line&#39;,
  title = &#39;Toxic IP Frequencies by Day&#39;,
  xlabel = &#39;Date&#39;, ylabel = &#39;Frequency&#39;,
  figsize = (10, 4)
  )
```

## Plotting with Pandas (`bar` Plot)

.pull-left[

.font80[

.center[**Data:**]


```python
# Aggregating the frequencies by country
country_freq = (
  merged_ips
  .groupby(&#39;country&#39;)
  .agg(sum_freq = (&#39;frequency&#39;, &#39;sum&#39;))
  .sort_values(&#39;sum_freq&#39;, ascending = False)
  .head(10)
  .reset_index()
)
country_freq.head(n=2)
```

```
##    country  sum_freq
## 0  Georgia   1712171
## 1  Ukraine    928770
```
]
]


.pull-right[

.font80[
.center[**Plotting:**]


```python
country_freq.plot(
  x = &#39;country&#39;, y = &#39;sum_freq&#39;, kind = &#39;barh&#39;,
  title = &#39;Top 10 Countries with Toxic IP Freq&#39;,
  xlabel = &#39;Country&#39;, ylabel = &#39;Frequency&#39;,
  figsize = (10, 6),
  color = &#39;red&#39;
  )
```

# Automated Viasualizations in Python

## The `ydata-profiling` Package

Data quality profiling and exploratory data analysis (EDA) are crucial steps in any business analytics application.   

[ydata-profiling](https://docs.profiling.ydata.ai/latest/) automates and standardizes the generation of detailed reports, complete with statistics and visualizations. 

The significance of the package lies in how it streamlines the process of understanding and preparing data for analysis in a single line of code!

---

## Usage of `ydata-profiling`


```python
import pandas as pd
*from ydata_profiling import ProfileReport

*profile = ProfileReport(sim_attack_df, title=&quot;Pandas Profiling Report&quot;, explorative=True)

# the next line is needed since I am not using Colab for making the slides
profile.to_file(&quot;../../figures/sim_attack_data_report.html&quot;) 
```
